async function (triggerRowIndex) {
  await GetAuthorizationMatrix.run();
  let versionListData = GetAuthorizationMatrix.data;
  let navigationData = {
    isView: GetVersionList.data[triggerRowIndex]['is_final'],
    navigateVersion: {
      versionNumber: appsmith.store.versionList[triggerRowIndex].version_number,
      data: versionListData.filter(item => item.version === appsmith.store.versionList[triggerRowIndex].version_number)[0].authorizeMatrix
    }
  };
  console.log(navigationData);
  storeValue("navigationData", navigationData, true);
}
